export default function MenuItems(props) {
    const {item} = props;
    return (
        <div className = "item">
            <h3>{item.name} ${item.price}
            </h3>
            <button className='customize_button'>Customize</button>
            <button className='customize_button'>+</button>
            <button className='customize_button'>-</button>

            <div className="place-holder">.</div>
        </div>
    )
}
